            <Table className="table-hover table-striped">
              <thead>
                <tr>
                  <th className="border-0">pk</th>
                  <th className="border-0">CI</th>
                </tr>
              </thead>
              <tbody>
                {viajeros &&
                  viajeros.map((viaje, index) => (
                    <tr key={index}>
                      <td>{1}</td>
                      <td>{viaje}</td>
                    </tr>
                  ))}
              </tbody>
            </Table>
          </Card.Body>
        </Card>
      </Col>
    </>
  );
};

export default TableReservacionesViajeros;
